import {REQUEST_STARTED} from "./constants";

export const requestSuccessful = ({ data }) => ({
  type: REQUEST_SUCCESSFUL,
  data,
});
export const requestStarted = ({ data }) => ({
  type: REQUEST_STARTED,
  data,
});
export const requestFailed = ({ data }) => ({
  type: REQUEST_FAILED,
  data,
});
